UPDATE `oferta` SET `Descripcion`="Tendrá como objetivo, dar soporte, tanto a los Ingenieros de Proyectos e Ingenieros de Diseño como a Comercial, en tareas que requieran presencia física en las instalaciones del cliente, así como en la captación de negocio. CHR(10) Principales tareas y responsabilidades: CHR(10) -Asistir a reuniones con clientes y planificar las de personal del Grupo con cliente. CHR(10) -Recopilar información del programa/proyecto. CHR(10) -Informar al cliente sobre el estado del proyecto mediante procedimiento establecido. CHR(10) -Gestionar documentación con cliente asociada al proyecto. CHR(10) -Resolver dudas técnicas con cliente. CHR(10) -Asistir a pruebas funcionales. CHR(10) -Dar soporte en rechazos/reclamaciones. CHR(10) -Establecer/desarrollar contactos en cliente y transmitir al Grupo. CHR(10) -Revisar estado del proyecto con el equipo de industrialización del Grupo y formarlo en los requisitos específicos de cliente. CHR(10) -Colaborar en la captación de negocio. CHR(10) Se requiere formación en ingeniería técnica, experiencia mínima de 3 años en el puesto y en el sector de automoción, inglés avanzado y disponibilidad para residir en Inglaterra.   " where id=247;
