UPDATE `oferta` SET `Descripcion`="Empresa del sector de automoción requiere un inspector de calidad para desempeñar las siguientes funciones: CHR(10) - Revisión y control de las piezas realizando la inspección de entrada, durante el proceso y la inspección final siguiendo las pautas de normalización. CHR(10) - Manejo de instrumentos de medición como calibrador, micrómetro, medidor de altura, etc. Posterior reporte del estatus de mediciones. CHR(10) - Informar al ingeniero/a de calidad si tiene cualquier duda o disconformidad. CHR(10) - Registrar los informes de inspección con el resultado correspondiente. CHR(10) - Gestión / devolución del material rechazado CHR(10) - Gestionar y coordinar las acciones de selección / retrabajo de piezas dudosas." where id=253;
UPDATE `oferta` SET `Descripcion`="Realiza tareas de trabajo con políticas, procedimientos e instrucciones de trabajo relativas a los requisitos de cliente, ISO y de seguridad. Desarrolla e implementa el Sistema de Gestión de Calidad y control de procesos en curso para prevenir los fallos y las deficiencias en productos y procesos. Participara en la realización de auditorías del sistema de calidad.  Interactúa con el cliente y proveedores, incluyendo el soporte en sus instalaciones, para asegurar que sus los productos cumplan con las especificaciones requeridas. Gestiona las investigaciones de calidad y procesos de auditorías relacionadas con el panel de proveedores seleccionados. Trabaja para asegurar que los resultados se apliquen a los esfuerzos de mejora de la calidad. Trabaja con los diferentes departamentos para implementar herramientas avanzadas de calidad, tales como planes de control, control estadístico de procesos, toma de muestras y análisis estadísticos, análisis de riesgos, etc., para asegurar que los procesos estén diseñados, implementados y operados para maximizar la calidad. Conoce, documenta, desarrolla e implementa las acciones necesarias para gestionar adecuadamente el APQP y crear el PPAP del producto. Proporciona el conocimiento para controlar y / o analizar los problemas de calidad y resolverlos mediante la implementación de soluciones de acuerdo con los requerimientos del cliente. Supervisa las acciones correctivas necesarias para asegurar que la/s causa/s raíz/ces son/sean identificada/s y asegura que las soluciones son aplicadas evitando su ocurrencia futura. Dar entrenamiento al personal en métodos básicos para tomar acciones preventivas y correctivas cuando sea requerido. Aplicar técnicas de tolerancia estadística para evaluar características dimensionales. Administrar las actividades de calidad con los cambios asociados en cambios de producto y proceso." where id=254;
UPDATE `oferta` SET `Descripcion`="Objetivo: Organizar operacionalmente las personas, la organización y los modos de funcionamiento del almacén realizando la gestión administrativa de recepción/expedición/almacenaje (Interna/externa) así como la correcta gestión de  los flujos desde la recepción hasta la expedición. CHR(10)  CHR(10) Principales tareas: CHR(10) Desarrollar KPI´s aplicados a los procesos propios. CHR(10) Dirigir y motivar el equipo humano de él dependiente, estableciendo los planes de trabajo y seguimiento de los mismos, de acuerdo a los criterios y metodologías establecido. Asegurar el cumplimiento de procesos de almacén, FIFO, trazabilidad, lotes mínimos/máximo. CHR(10) Llevar a cabo la gestión de inventarios, control de stock, integridad de datos. CHR(10) Gestionar incidencias de almacén, incentivos, propuestas de mejoras. CHR(10) Controlar y llevar el mantenimiento de activos de almacén (Estanterías, carretillas, muelles, naves, etc.) CHR(10) Analizar las estrategias de almacenamiento, preparación de nuevos procesos de proyectos y controlar el mantenimiento de los mismos . Formación continua, concienciación operarios almacén,  Lay out, polivalencias, mejora de actividades proceso etc CHR(10) Requisitos:&#61607; CHR(10) -Ingeniero Organización. CHR(10) -Experiencia entre 1 y 3 años en el puesto. CHR(10) -Conocimientos ERP, MRP, SGA. CHR(10) -Nivel de inglés avanzado. CHR(10) -Experiencia en la gestión de equipos. CHR(10) -Valorable experiencia en el sector." where id=256;
