ator needs. CHR(10) Identify relevant customer`s specifications and assess the ones applicable to assembly and customer service needs. CHR(10) Analyses assembly DMU studies and manage cockpit DMU activities with the DMU engineer. CHR(10) Manage architecture constraints with the architect and design engineers CHR(10) Has basic knowledge on assembly technologies. CHR(10) Has basic knowledge on final testing technologies. CHR(10) Contributes to cost analysis by providing key parameters (times & equipments). CHR(10) Provides and defend technical data for negotiations with suppliers and customers. CHR(10) Insure relation with customer manufacturing engineering regarding cockpit decking in vehicle. CHR(10) Provides to the internal team the customer assembly constraints and support related design constraints CHR(10) Understands logistics packaging constraints and adapt assembly process accordingly, and / or propose alternative logistics solutions. CHR(10) Deliverables: CHR(10) -Assembly sequence (In accordance with time, ppm & operators safety targets) . CHR(10) -Assembly detailed operation description. CHR(10) -DFA checklist CHR(10) -DFA synthesis CHR(10) -Cockpit PFMEA. CHR(10)  CHR(10) AVAILABILITY TO TRAVEL EUROPE AND EEUU" where id=259;
